import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";


const ExtensionsList = () => {
    const devicesData = useSelector(state => state.devicesData.item[0]);

    return (
        <React.Fragment>
            <ul>
                {
                    devicesData.item[0].map((i , item) => {
                        return (
                            <li key={i}>
                                <p>a</p>
                            </li>
                        )

                    })
                }
            </ul>
        </React.Fragment>
    )
}


export default ExtensionsList;
